import styles from "./Card.module.css";
import { NavLink } from "react-router-dom";
export default function Card(id, name, status, species, gender, origin, image, onClose) {
  
   return (
       <div className={styles.conteiner}>
        
        <div className={styles.div
      }>
         
         <button className={styles.boton} onClick={()=>onClose(id)}>X</button>
         <NavLink to={`/detail/${id}`}>
         <h2 className={styles.letraTitulo}>{name}</h2>
         </NavLink>
         <h2 className={styles.leter}>status:{status}</h2>
         <h2 className={styles.leter}>Species:{species}</h2>
         <h2 className={styles.leter}>Gender:{gender} </h2>
         {/* <h2>origen:{character.origen.name}</h2> */}
         <img className={styles.imgen} src={image} alt={name} />
         
         </div>
      </div>
   );
}
